    [],nt"revision_timestamp": "2015-06-19T15:41:46.196376",nt"name": "digital-flood-insurance-rate-map-database-williamsburg-county-sc-and-incorporated-areas",nt"isopen":
    false,nt"url": null,nt"notes": "The Digital Flood Insurance Rate Map (DFIRM)
    Database depicts flood risk information and supporting data used to develop the
    risk data. The primary risk classifications used are the 1-percent-annual-chance
    flood event, the 0.2-percent-annual- chance flood event, and areas of minimal flood
    risk. The DFIRM Database is derived from Flood Insurance Studies (FISs), previously
    published Flood Insurance Rate Maps (FIRMs), flood hazard analyses performed in
    support of the FISs and FIRMs, and new mapping data, where available. The FISs and
    FIRMs are published by the Federal Emergency Management Agency (FEMA). This file
    is georeferenced to the earth's surface using the New Mexico Central State Plane
    (FIPS 3002), feet, North American Datum 1983(NAD83), projection and coordinate system.
    The specifications for the horizontal control of DFIRM data files are consistent
    with those required for mapping at a scale of 1:12,000. The Vertical Datum of this
    data set is North American Vertical Datum 1988 (NAVD88). The specifications for
    the vertical control of DFIRM data files are consistent with those required for
    mapping at a vertical accuracy of 2.4 feet or better.",nt"license_title": null,nt"extras":
